its, you’ll discover a ton of training information to help benefit your performance. Expect fresh material and insights on a regular basis as posts made almost daily keep you informed. Hear from a number of different contributors about their perspectives on what it takes to succeed and about their experiences with new equipment, performance, training and more.'),(2,'Delicious',_binary '\\\0JFIF\0,,\0\0\Exif\0\0II*\0\0\0\0\0\0\0\0\Z\0\0\0\0\0\0\0Food backgrounds: top view of a rustic wooden table filled with different types of food. At the center of the frame is a cutting board with beef steak and a salmon fillet and all around it is a large variety of food like fruits, vegetables, cheese, bread, eggs, legumes, olive oil and nuts. DSRL studio photo taken with Canon EOS 5D Mk II and Canon EF 70-200mm f/2.8L IS II USM Telephoto Zoom Lens\http://ns.adobe.com/xap/1.0/\0<?xpacket begin=\"﻿\" id=\"W5M0MpCehiHzreSzNTczkc9d\"?>\n<x:xmpmeta xmlns:x=\"adobe:ns:meta/\">\n	<rdf:RDF xmlns:rdf=\"http://www.w3.org/1999/02/22-rdf-syntax-ns#\">\n		<rdf:Description rdf:about=\"\" xmlns:photoshop=\"http://ns.adobe.com/photoshop/1.0/\" xmlns:Iptc4xmpCore=\"http://iptc.org/std/Iptc4xmpCore/1.0/xmlns/\"   xmlns:GettyImagesGIFT=\"http://xmp.gettyimages.com/gift/1.0/\" xmlns:dc=\"http://purl.org/dc/elements/1.1/\" xmlns:plus=\"http://ns.useplus.org/ldf/xmp/1.0/\"  xmlns:iptcExt=\"http://iptc.org/std/Iptc4xmpExt/2008-02-29/\" xmlns:xmpRights=\"http://ns.adobe.com/xap/1.0/rights/\" photoshop:Credit=\"Getty Images/iStockphoto\" GettyImagesGIFT:AssetID=\"1155240408\" xmpRights:WebStatement=\"https://www.istockphoto.com/legal/license-agreement?utm_medium=organic&amp;utm_source=google&amp;utm_campaign=iptcurl\" >\n<dc:creator><rdf:Seq><rdf:li>fcafotodigital</rdf:li></rdf:Seq></dc:creator><dc:description><rdf:Alt><rdf:li xml:lang=\"x-default\">Food backgrounds: top view of a rustic wooden table filled with different types of food. At the center of the frame is a cutting board with be